import { connect, useDispatch } from 'react-redux';
import { withRouter } from 'react-router-dom';

function ThankYou(props) {

  let dispatch = useDispatch();

  const sendInfo = (path) => {
    switch (path) {
      case 'forward':
        dispatch({
          type: 'ADD_CUSTOMER',
          payload: props.store.customerInfo
        });
        dispatch({
          type: 'QUOTE_PROGRESS',
          payload: { divisor: 8, step_number: 0 }
        });
        props.history.push('/');
        break;
      case 'back':
        dispatch({
          type: 'QUOTE_PROGRESS',
          payload: { divisor: 8, step_number: 7 }
        });
        props.history.push('./back-to-black');
        break;
      default:
    }
  };

  return (
    <div>

      <h2>Thank You</h2>
      <p>Thank you for submitting this form!</p>
      <button onClick={() => sendInfo('back')}>Go to Back to Black</button>
      <button className='btn primary_btn' onClick={() => sendInfo('forward')}>Go home</button>

    </div>
  );
}

export default connect()(withRouter(ThankYou));
